import java.awt.*;

public class Day5 {
    //private static String input = "dabAcCaCBAcCcaDA";
    private static String input = "";

    public static void partOne() {
        System.out.println("Day Five, Part One:");
        System.out.println(reactPolymer(input));
    }

    public static void partTwo() {
        System.out.println("Day Five, Part Two:");
        String allUnitTypes = "abcdefghijklmnopqrstuvwxyz";
        int shortestLength = Integer.MAX_VALUE;

        for (char c : allUnitTypes.toCharArray()) {
            String polymerString = input;
            polymerString = polymerString.replace("" + c, "");
            polymerString = polymerString.replace("" + Character.toUpperCase(c), "");
            int reactedLength = reactPolymer(polymerString);
            if (reactedLength < shortestLength) {
                shortestLength = reactedLength;
            }
        }

        System.out.println(shortestLength);
    }

    private static int reactPolymer(String polymerString) {
        String lastOutput = polymerString;
        boolean changesMade = true;

        while (changesMade) {
            StringBuilder output = new StringBuilder();
            changesMade = false;
            char[] arr = lastOutput.toCharArray();
            for (int i = 0; i < arr.length; i++) {
                String c1 = "" + arr[i];
                if (i == arr.length - 1) {
                    output.append(c1);
                } else {
                    String c2 = "" + arr[i + 1];

                    if (c1.equalsIgnoreCase(c2)
                            && !c1.equals(c2)) {
                        i++;
                        changesMade = true;
                    } else {
                        output.append(c1);
                    }
                }
            }
            lastOutput = output.toString();
            //System.out.println(lastOutput);
        }
        return lastOutput.length();
    }
}
